s.aO(0,"Raycasting (light)",new A.b6r(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_light_example.dart","In this example the raycast functionality is showcased by using it as a light\nsource, if you move the mouse around the canvas the rays will be cast from its\nlocation. You can also tap to create a permanent source of rays that wont move\nwith with mouse.\n  ")
